    'session_id': 'session-456',
    'image_id': 'normal/aurora-lake.svg',
    'description': 'The image shows a beautiful sunset...',
    'rating': 8,
    'feedback': 'Interesting image',
    'time_spent_seconds': 45,
    'is_survey': False,
    'is_attention': False,
    'username': 'john_doe',
